import React from "react";
import IInfos from "../../types";

export default function Lista({names}: {names: IInfos[]}){
    return(
        <div className="ListWrapper">
            <ul>
                {names.map((item: IInfos, index:any) => ( //its important that here is return, cuz react only renders returned elements!
                <li key={index}>
                <h3></h3>{item.Model}
                        <span>{item.Licenseplate}</span>
                </li>
                
                ))}
            </ul>
        </div>

    )
}
